export interface Albums{
    id:         number;
    img_url:    string;
    title:      string;
    name:       string;
}

export interface PlayList{
    id:         number;
    img_url:    string;
    title:      string;
}

export interface Artists{
    id:         number;
    img_url:    string;
    name:       string;
    prof:       string;
}

export interface Songs{
    id:         Number;
    title:      string;
    img_url:    string;
    artist:     Number;
    album:      Number;
    path:       string;
    liked:      boolean;
    playlist:   Number[];
}

export interface Token{
    access: String;
    refresh: String;
}

